import Footer from './Components/Footer';
import Voiture from './Components/Voiture'
import VoitureListe from './Components/VoitureListe'
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'

function App() {

    return (
        <div className="App">
            <NavigationBar />
            <Container>
                <Bienvenue/>
                <Voiture/>
                <VoitureListe/>,
            </Container>
            <Footer/>
        </div>
    );
}

export default App;
